    let icoSize = "3x"
    return (
        <div className={"SocialMedia-container"} id="SocialMedia">
            <h2>Social Media</h2>
            <hr/>
            <div className="link-container">
            <a className={"Github"}><FontAwesomeIcon className={"icon"} icon={faGithub} size={icoSize}/></a>
            <a className={"LinkedIN"} href={"https://www.linkedin.com/in/winston-reichelt-88a8522a8/"}><FontAwesomeIcon icon={faLinkedin} size={icoSize}/></a>
            <a className={"Youtube"} href={"https://www.youtube.com/channel/UCtA3QjX9Ic70OhlpcA1QR2w"}><FontAwesomeIcon icon={faYoutube} size={icoSize}/></a>
        </div>
        </div>
    )
}

export default SocialMedia;
